import React from 'react';
import Grid from '@material-ui/core/Grid';
import { SearchBar, TagsSections } from '../../molecules';
import { TextSearch } from '../../atoms';
import './index.scss';

export const SearchContainer = () => {
  return (
    <Grid
      container
      justifyContent='center'
      alignItems='center'
      className='search-container'
    >
      <Grid item xs={12} sm={12}>
        <TextSearch />
      </Grid>
      <Grid item align='center' xs={12} sm={12} className='search-section'>
        <SearchBar />
        <TagsSections />
      </Grid>
    </Grid>
  );
};
